import Layout from '../components/MyLayout';
import Link from 'next/link';

const PostLink = (props) => (
  <li>
    <Link href={`/post?title=${props.title}`}>
      <a>{props.title}</a>
    </Link>
  </li>
);

export default function Blog() {
  return (
    <Layout>
      <h1>My Blog</h1>
      <p>Hello Next.js</p>
      <Link href="/about">
        <a title="About Page">About Page</a>
      </Link>
    </Layout>
  );
}
